import React from "react";
import about from "../src/images/about.jpg";

export const About =()=>{
    return(
        <>
        <section id="header" className="">
        <div class="container">
  <img src={about} alt="Snow" style="width:100%;" />
  <div >Bottom Left</div>
  <div >Top Left</div>
  <div>Top Right</div>
  <div >Bottom Right</div>
  <div>Centered</div>
   </div>
        
           </section>
        </>
    )
    

};

export default About;
